script: |
  super -f text -I q13486.spq | sort > q13486.out

inputs:
  - name: q13486.spq
    data: |
      SELECT - COUNT ( * ) - 26 * + 96 AS col2 FROM tab0 (FORMAT parquet) WHERE + 2 * col0 NOT BETWEEN 33 * CAST ( + 7 / 91 AS REAL ) AND 52;
  - name: tab0

outputs:
  - name: q13486.out
    data: |
      -2498
